import { Link } from 'react-router-dom';
import React from "react";
import profileImage from '../images/image.png'
import "./MyPage.css"

function MyPage() {
    const ImageWrap = styled.div`
  margin: 0 auto
`;
    return(
        <div className='container'>
            <aside>
                <ImageWrap>
                <img src='protileImage' alt='프로필 사진'/>
                </ImageWrap>
            <button><Link className='editButton' to={'/edit-profile'}>수정하기</Link></button>
            <p>박범준</p>

            <Link className='mypage-navbar' to={'/mypage'}>홈</Link><br/>
            <Link className='mypage-navbar' to={'/mypage-free'}>자유 게시글</Link><br/>
            <Link className='mypage-navbar' to={'/mypage-question'}>질문 게시글</Link><br/>
            <Link className='mypage-navbar' to={'/mypage-study'}>스터디 게시글</Link><br/>
            <Link className='mypage-navbar' to={'/mypage-friend'}>친구 목록</Link>
            </aside>
            <article>
                <h1>소개글이 비었어요.</h1>
            </article>
        </div>
    );
}

export default MyPage;
